int change(string i,int P){
	int ans=0;
	for(char ch:i){
		ans=(ans*10ll+(ch^'0'))%P;
	}
	return ans;
}
int n,P;
int main(){
	freopen("lcm.in","r",stdin);
	freopen("lcm.out","w",stdout);
	
	ios::sync_with_stdio(false);
	cin.tie(0);cout.tie(0);
	
	int T;
	cin>>T;
	while(T--){
		cin>>n>>P;
		int ans=0;
		for(int i=1;i<=n;i++){
			ans=(ans+(ll)change(g[i],P)*i)%P;
		}
		cout<<ans<<'\n';
	}
	
	cout.flush();
	
	fclose(stdin);
	fclose(stdout);
	return 0;
}
